export class BannerComponent implements OnInit{

  constructor() { }

  ngOnInit(): void {
  }

}
<div class="row" id="Banner">
    <div class="row">
        <img src="../../../assets/img/Banner.jpg" id="fotoBanner" alt="custom-banner" class="img-fluid">
